import {Service} from './Service'
export function login(data) {
  return Service({
    url: '/login',
    method: 'post',
    data: data
  })
}
export function register(data) {
  return Service({
    url: '/register',
    method: 'post',
    headers: {
      'Content-Type': 'application/x-www-form-urlencoded'
    },
    data: data
  })
}
// 账号管理 导入
export function accountUpload(data) {
  return Service({
    url: '/account/upload/',
    method: 'post',
    data: data
  })
}
// 账号管理 导出
export function accountDownload(data) {
  return Service({
    url: '/account/download/',
    method: 'post',
    data: data
  })
}
// 账号管理 查询
export function accountQuery(data) {
  return Service({
    url: '/account/sel/',
    method: 'post',
    data: data
  })
}
// 账号管理 清空
export function accountRemoveall(data) {
  return Service({
    url: '/account/removeall/',
    method: 'post',
    data: data
  })
}

// 管理员页面 查询
export function userQuery(data) {
  return Service({
    url: '/user/selall/',
    method: 'post',
    data: data
  })
}
// 管理员页面 添加用户
export function addUser(data) {
  return Service({
    url: '/user/regist/',
    method: 'post',
    data: data
  })
}
// 管理员页面 上传评论内容
export function uploadContent(data) {
  return Service({
    url: '/content/addcontent/',
    method: 'post',
    data: data
  })
}
// 管理员页面 设置代理
export function setProxy(data) {
  return Service({
    url: '/proxy/setting/',
    method: 'post',
    data: data
  })
}
// 任务管理  查询任务
export function taskQuery(data) {
  return Service({
    url: '/mission/sel/',
    method: 'post',
    data: data
  })
}
// 任务管理  今日完成任务数
export function querytoday(data) {
  return Service({
    url: '/mission/querytoday/',
    method: 'post',
    data: data
  })
}
// 任务管理  添加任务
export function addTask(data) {
  return Service({
    url: '/mission/add/',
    method: 'post',
    data: data
  })
}
// 任务管理  批量添加任务
export function addMoreTask(data) {
  return Service({
    url: '/mission/addmore/',
    method: 'post',
    data: data
  })
}
// 任务管理  取消按钮
export function cancelTask(data) {
  return Service({
    url: '/mission/cancel/',
    method: 'post',
    data: data
  })
}
